class extends LitElement {
  constructor(props) {
    super();
    __privateAdd(this, _onButtonClicked);
    this.postStyle = "normal";
    this.kind = "quote";
    this.userTooltip = null;
    this.keywordTooltip = null;
    this.lang = "en";
    this.withIcons = false;
    if (props) {
      Object.assign(this, { ...this, ...props });
    }
  }
  get tooltip() {
    return [this.userTooltip, this.keywordTooltip].filter((s) => Boolean(s)).join("   |   ");
  }
  get buttonText() {
    switch (this.lang) {
      case "en": {
        return `show ${this.kind}`;
      }
      case "ru": {
        return `\u041F\u043E\u043A\u0430\u0437\u0430\u0442\u044C ${this.kind === "post" ? "\u0441\u043E\u043E\u0431\u0449\u0435\u043D\u0438\u0435" : "\u0446\u0438\u0442\u0430\u0442\u0443"}`;
      }
    }
  }
  render() {
    const userIcon = this.userTooltip ? html`<icon-blocked-user title="${this.userTooltip}"></icon-blocked-user>` : nothing;
    const keywordIcon = this.keywordTooltip ? html`<icon-monkey title="${this.keywordTooltip}"></icon-monkey>` : nothing;
    const icons = this.withIcons && this.tooltip ? html`<div part="icons">${userIcon}${keywordIcon}</div>` : nothing;
    return html`
			${icons}
			<button part="button" @click=${__privateMethod(this, _onButtonClicked, onButtonClicked_fn)} title=${ifDefined(this.tooltip)} type="button">
				${this.buttonText}
			</button>
		`;
  }
}

